int solve2(int ele, vector<vector<int>> v, vector<int> visited) {
    
    visited[ele] = 1;
    
    vector<int> x = v[ele];
    int flag = 0;
    
    for(int i = 0; i < x.size(); i++) {
        if(visited[x[i]] == 0) {
            flag = 1;
            break;
        }
    }
    
    int ans = 0;
    
    int flag2 = 0;
    if(flag == 1) {
        return 0;
    }else{
        for(int j = 1; j <= visited.size()-1; j++) {
            if(visited[j] == 0) {
                flag2 = 1;
                ans = solve2(j, v, visited);
                if(ans == 1) {
                    return 1;
                }
            }
        }
    }
    
    if(flag2 == 0) {
        return 1;
    }
    
    return 0;
}

int solve(int A, vector<int> B, vector<int> C) {
    
    vector<vector<int>> v(A+1);
    for(int i = 0; i < C.size(); i++) {
        v[C[i]].push_back(B[i]);
    }
    
    unordered_map<int, int> mp;
    
    for(int i = 1; i <= A; i++) {
        if(v[i].size() == 0){
            mp[i] = 1;
        }
    }
    
    vector<int> visited(A+1, 0);
    
    int ans = 0;
    for(auto m : mp) {
        visited = vector<int> (A+1, 0);
        ans = solve2(m.first, v, visited);
        if(ans == 1)
            return 1;
    }
    
    return 0;
    
}


